import axios from 'axios';

const API_URL = 'http://127.0.0.1:8000/'; // Change to your API endpoint

//data.name, data.category, data.iddsi_level
const setItems = (name: string, category: string, iddsi_level: string ) => {
  return axios.post(API_URL + '/createitems', {
    name,
    category,
    iddsi_level
  });
};

const getItems = (name: string, category: string, iddsi_level: string) => {
    return axios.post(API_URL + '/getitems', {
    name,
    category,
    iddsi_level
    });
};

const editItems = (name: string, category: string, iddsi_level: string) => {
    return axios.post(API_URL + '/edititems', {
        name,
        category,
        iddsi_level
    });
};

const updateItems = (name: string, category: string, iddsi_level: string) => {
    return axios.post(API_URL + '/updateitems', {
        name,
        category,
        iddsi_level
    });
};

const bulkUpdate = (name: string, email: string, password: string ,password_confirmation: string) => {
    return axios.post(API_URL + '/bulkuploaditems', {
      name,
      email,
      password,
      password_confirmation,
    });
};


export default {
  getItems,
  setItems,
  editItems,
  updateItems,
  bulkUpdate

};
